    width:'100%',
    maxWidth:'100%',
    maxHeight:'100%',
    boxShadow:'none',
    overflow:'hidden',
    margin:'20px'
}

const componenet=styled(Box)`
 dis
`

const ChatDialog = () => {

   return (

    <Dialog
       open={true}
       PaperProps={{sx:dialogStyle}}
       hideBackdrop={true}
    >

     <Box>
        <Box>
            <Menu/>
        </Box>

        <Box>

            <EmptyChat/>

        </Box>
        
     </Box>   


    </Dialog>
    
   )
}

export default ChatDialog;
